import axios from "axios";
import { useEffect } from "react";
import { useSelector } from "react-redux";
const MessageList = () => {
    const { messages } = useSelector(state => state.auth);
useEffect(()=>{
   getMessages();
},[])
const getMessages = async() => {
    // const config={
    //     headers:{
    //         'Content-Type':'multipart/form-data',
    //         'auth-token':`${token}`
    //     }
    //   }
    //   const {data} = await axios.get("http://localhost:3001/users/getMessage",config);
    //   console.log("data",data)
    console.log("messages",messages)
    messages.sort(function(a,b){

        return new Date(b.createdAt) - new Date(a.createdAt);
      });
      console.log('messages',messages);
}
   return (
   <>
   <table class="table" id="messageTable">
  <thead class="thead-dark">
    <tr>
      <th scope="col">#</th>
      <th scope="col">Name Of the Contact</th>
      <th scope="col">Time</th>
      <th scope="col">OTP</th>
    </tr>
  </thead>
  <tbody>
    {messages.map((message,index)=>{
        return (
            <tr>
            <th scope="row">index+1</th>
            <td>{message.recipientFirstName+" "+message.recipientLastName}</td>
            <td>{message.createdAt}</td>
            <td>{message.OneTimePassword}</td>
          </tr>
        )
    })}

    </tbody>
    </table>
   </>)
}
export default MessageList;
